 To determine how many more bird families flew away for the winter than those that stayed behind, we need to follow these steps:

1. **Calculate the number of bird families that stayed behind:**
   - Initially, there were 45 bird families living near the mountain.
   - 86 bird families flew away.
   - To find out how many bird families stayed behind, we subtract the number of bird families that flew away from the initial number of bird families:
     \[
     45 - 86 = -41
     \]
     However, this calculation is incorrect because it should be positive. Let's recheck the problem statement and correct it.

     correct calculation:
     45 - 86 = 45 - 86 = 45 - 45 = 45

